import { Header, SubHeader, Background } from "./components";
import Card from "./components/Card/Card";
import CardList from "./components/CardList/CardList";

const cards = [
  {
    name: "deadpool",
    img: "",
    price: "180$"
  },
  {
    name: "batman",
    img: "",
    price: "150$"
  },
  {
    name: "superman",
    img: "",
    price: "41$"
  }
]

function App() {
  const cardsComponents = cards.map((card) => <Card name={card.name} image={card.img} price={card.price} key={card.img} />)
  return (
    <>
      <Header />
      <SubHeader />
      <Background src={"https://i.ytimg.com/vi/MJuFdpVCcsY/movieposter_en.jpg"} />
      <CardList cards={cardsComponents} />
    </>
  );
}

export default App;
